import React, { useState } from 'react';
import Navbar from './Navbar';
import TodoList from './TodoList';
import Notes from './Notes';
import Blog from './Blog';
import Schedule from './Schedule';
import './App.css';

const App = () => {
  const [activePage, setActivePage] = useState('home');

  return (
    <div className="app-container">
      <Navbar setActivePage={setActivePage} />
      <div className="page-container">
        {activePage === 'todo' && <TodoList />}
        {activePage === 'notes' && <Notes />}
        {activePage === 'blog' && <Blog />}
        {activePage === 'schedule' && <Schedule />}
        {activePage === 'home' && (
          <div className="home">
            <h1>PlannerPal</h1>
            <div className="quick-actions">
              <h3>Quick Actions</h3>
              <div className="actions">
                <button onClick={() => setActivePage('todo')}>Go to To-Do</button>
                <button onClick={() => setActivePage('notes')}>Go to Notes</button>
                <button onClick={() => setActivePage('blog')}>Go to Blog</button>
                <button onClick={() => setActivePage('schedule')}>Go to Schedule</button>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default App;
